import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => <h1>Todo List</h1>;


const TodoList = () => {
  return (<ul>
    <li>Learn React</li>
    <li>Build awesome App</li>
  </ul>);
}

const el = (
  <div>
    <input placeholder='search' />
    <TodoList />
  </div>
);
ReactDOM.render(el,
  document.getElementById('root'));
